--
-- Filler data to simplify OSM country data.
--
-- Each polygon in the file will be added and/or substracted from the
-- country polygon given in the add_country and sub_country columns.

CREATE TABLE public.country_fills (
    id integer NOT NULL,
    add_country text,
    sub_country text,
    geometry public.geometry(Polygon,4326)
);

CREATE SEQUENCE public.country_fills_id_seq
    AS integer
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;


ALTER TABLE ONLY public.country_fills ALTER COLUMN id SET DEFAULT nextval('public.country_fills_id_seq'::regclass);


ALTER TABLE ONLY public.country_fills
    ADD CONSTRAINT country_fills_pkey PRIMARY KEY (id);
